import React from "react";

import "./styles.scss";

const Card = () => {
  return (
    <div className="card-container">
      <div className="left"></div>
      <div className="right">
        <div>
          <button className="btn btn-primary">ACCEPT</button>
        </div>
        <div>
          <button className="btn btn-primary">REJECT</button>
        </div>
      </div>
    </div>
  );
};

export default Card;
